import { useEffect, useState} from "react";
import axios from "axios";


import "./App.css"


function App(){

  
  const url = "http://localhost:8003/PerguntaSelecionadaPacientes";
  
  const [posts, setPosts] = useState([]);
  console.log(posts)

 
  useEffect(() => {
    axios.get(url)
      .then((response) => {
        setPosts(response.data);
      })
      .catch((error) => console.error(error));
  }, []);


  

  return(
    <div className="App" >  
    <div  className="Colum"> 
      <div className="cont">
          <center><h2  >Selecionar Pergunta</h2></center>
          
            <div>
            {posts.map((post) => (
              <div >
                <p>{posts.infoPaciente}</p>
                <p>{posts.selectedQuestions}</p>
              </div>
            ))}
            </div>
              
              </div> 
          
            </div>
          
      </div>
 
  )
}

export default App
